import React, { useState, useEffect } from "react";
import { connect } from "react-redux";

import MUIDataTable, { MUIDataTableOptions } from "mui-datatables";
import { loadDatabase } from "./Redux/actions";
import { useHistory } from "react-router-dom";
import { useAuth0 } from "../../App/react-auth0-spa";

interface TableProps {
    // uniqueColumns: any[];
    // databaseList: any[];
    databaseEntries: any[];
    // dispatchDatabaseList: any;
    dispatchLoadDatabase: any;
    location: any;
}

function Table(props: TableProps): React.ReactElement {
    let history = useHistory();
    const { getTokenSilently } = useAuth0();
    const [token, setToken] = useState();

    useEffect(() => {
        const fetchDatabaseList = async () => {
            const newToken = await getTokenSilently();
            setToken(newToken);
            const urlIndex = props.location.pathname.lastIndexOf("/") + 1;
            const currentTable = props.location.pathname.slice(urlIndex);
            console.log("what is the current table: ", currentTable)
            // props.dispatchLoadDatabase(newToken,)
        };
        fetchDatabaseList();
    }, []);

    return (
        <div>
            Hi
        </div>
    )
}

const mapStateToProps = (state: any) => {
    return {
        databaseEntries: state.database.data
    }
}

const mapDispatchToProps = (dispatch: any) => {
    return {
        dispatchLoadDatabase: (token: string, tableName: string, page: string, pageSize: string) => dispatch(loadDatabase(token, tableName, page, pageSize))
    }
}

export default connect(
    mapStateToProps,
    mapDispatchToProps
)(Table);
